import './App.css';
import Header from './components/Header/Header'
import SideNav from './components/SideNav/SideNav'
import Videos from './components/Videos/Videos'




function App() {
  return (
    <>
     <Header/>
     <div className='mainPage'>
     <SideNav className="sideNav"/>
     <Videos/>
     </div>

    </>
  );
}

export default App;
